class App extends Component {
	constructor() {
		super();
		this.state = {
		input: '',
		}
	}

	onInputChange = (event) => {
		console.log(event.target.value);
	}

	onButtonSubmit = () => {
		console.log('click');
		app.models.predict("94fcec7fc44d4da5b7c0450d8d1bb734", "https://i.insider.com/5d321d4ea209d3146d650b4a?width=1100&format=jpeg&auto=webp").then(
		function(response) {
			console.log(response)
		},
		function (err) {

		}
		)
		// app.models.predict(
		//   Clarifai.FACE_DETECT_MODEL,
		//   "https://samples.clarifai.com/face-det.jpg"
		//   )
		//   .then((response) => {
		//    console.log(response);
		//   })
		//   .catch((err) => {
		//    console.log(err);
		//   });
	}

	render() {
		return (
		<div className="App">
			<Particle className='particle'/>
			<Navigation />
			<Logo />
			<Rank />
			<ImageLinkForm onInputChange={this.onInputChange} onButtonSubmit={this.onButtonSubmit}/>

			{/* <FaceRecognition /> */}
		</div>
		);
	}
}

export default App;
